import React from "react";
import axios from "axios";

export default class List extends React.Component {

state = {
  ssds: []
}
state = {
  category: []
}

componentDidMount(){
  axios.get('http://localhost:9090/ssd/list').then(res => {
    const ssds = res.data;
    this.setState({ ssds });

    const cat = res.data;
    this.setCategory({ cat });
  })
}
render(){
  return (
    <ul>
      {this.state.ssds.map((ssd) => (
        <li key={ssd.id}>
          {ssd.brand}
          <li key={ssd.model}>{ssd.model}</li>
          <li key={ssd.id}>{ssd.serialNumber}</li>
          <li key={ssd.id}>{ssd.size}</li>
          <li key={ssd.id}>{ssd.purchasePrice}</li>
          <li key={ssd.id}>{ssd.purchaseDate}</li>
          <li key={ssd.id}>{ssd.arrivalDate}</li>
          <li key={ssd.id}>{ssd.saleValue}</li>


        </li>
      ))}
    </ul>
  );
}

}
